import { Button } from '@material-ui/core';
import './App.css';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import { styled } from '@mui/material/styles';
import heroImage from '../src/hero.svg'
import Box from '@material-ui/core/Box';
import me from '../src/me.svg';
import interviews from '../src/interviews.svg';
import notion1 from '../src/notion1.svg';

function Process() {
  return (
    <Container maxWidth="xl" style={{ background: '#F2E7D6', position: "fixed"}}>
     <Grid container spacing = {2} alignContent="flex-end"  alignItems="flex-end" justifyContent="center" style={{paddingLeft: "8%", width: "50%"}}> 
      <Grid item xs={1}>
          <Box p={0}>
           <h1 style = {{fontSize: 48, fontFamily: "yeseva one", position: "relative"}}>The Process</h1>
          </Box>
        </Grid>
        <Grid item xs={5}>
          <Box p={0}>
            <img className="my-svg" src = {notion1} height = "150px" width = "150px"style = {{position: "sticky", "paddingRight": "10%"}}/>
          </Box>
        </Grid> 
    </Grid>
    <hr  style={{ width: '150%', marginLeft: "8%", borderColor: "black"}}/>
        <Box p={0}>
          <p style = {{marginLeft: "8%", width: "150%", fontFamily:"josefin sans", fontSize: 24, position: "relative"}}>A customer-oriented consulting process. Whatever the challenge, time frame, and budget, I can help you on your journey to success.
            A process with the ultimate goal of making you happy. </p>
          </Box>
    </Container>
  )
}

export default Process;
